// import state from './state'
let rerenderr
export default function observ(rerender){
    return rerenderr = rerender
}


export function dispath(action){
    switch (action.type){
        case 'RERENDER_THREE':
            rerenderr()
        break;
        default:
            console.log('check');

        break;
    }
}
